import React from "react";
import Card from "./Card";

const Services = () => {
  return (
    <>
      <section id="service-section">
        <div className="container-fluid">
          <h1 className="">our services</h1>
          <div className="row">
            <div className="col-10">
              <div className="row">
                <Card />
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};
export default Services;
